void print_array(double array[r][c]) {
	for (int i = 0; i < r; i++) {
		for (int j = 0; j < c; j++) {
			printf("%lf ", array[i][j]);
		}
		printf("\n");
	}
}

void encode(int G_row[num_2],int G_column[num_2],int u[r],int v[c]) {
	int temp;
	for (int j = 0; j < c; j++) {
		temp = 0;
		for (int count = 0; count < num_2; count++) {
			if (G_column[count] == j+1) {
				temp = u[G_row[count] - 1] + temp;
			}
		}
		v[j] = temp % 2;
	}
}

void modulation(int v[c]) {
	for (int i = 0; i < c; i++) {
		if (v[i] == 0) {
			v[i] = -1;
		}
	}
}

void channel(double dB,int v[c], double receive[c],double Q_initial[c]) {
	double SNR = pow(10, (dB * 0.1));
	double N0 = (Eb / ( SNR * (coderate)));
	double sigma = 0;
	for (int i = 0; i < c; i++) {
		receive[i] = v[i] + sqrt(N0 * 0.5) * Normal();
		sigma = 2 * coderate * SNR;
		Q_initial[i] = (-2) * receive[i] * sigma;

	}
}

int sign_function(int H_row[num_1], int H_column[num_1], double Q[r][c], int r_sign, int c_sign) {
	int temp = 1;
	for (int count = 0; count < num_1; count++) {
		if (H_row[count] == r_sign) {
			if (H_column[count] != c_sign) {
				temp = sign(Q[H_row[count] - 1][H_column[count] - 1]) * temp;
			}
		}
	}
	return temp;
}

